import React from 'react'
import { Stack,Paper } from '@mui/material'
import test from './test1.jpg'

const Testimonial = () => {

    const imagestyle={height:"200px"}
  return (
    <div>
      <Paper elevation={5}>
        <img src={test} style={imagestyle}></img>
      </Paper>
    </div>
  )
}

export default Testimonial
